import { useState } from 'react';

function Create({ values, onClick }) {
  return (
    <button className="square" onClick={onClick}>
      {values}
    </button>
  );
}

function Board({ next, boxs, play }) {
  function handleClick(i) {
    if (calculateWinner(boxs) || boxs[i]) {
      return;
    }
    const nextSquares = boxs.slice();
    if (next) {
      nextSquares[i] = 'X';
    } else {
      nextSquares[i] = 'O';
    }
    play(nextSquares);
  }

  const winner = calculateWinner(boxs);
  let status;
  if (winner) {
    status = 'Winner: ' + winner;
  } else {
    status = 'Next player: ' + (next ? 'X' : 'O');
  }

  return (
    <>
      <div className="status">{status}</div>
      <div className="board-row">
        <Create values={boxs[0]} onClick={() => handleClick(0)} />
        <Create values={boxs[1]} onClick={() => handleClick(1)} />
        <Create values={boxs[2]} onClick={() => handleClick(2)} />
      </div>
      <div className="board-row">
        <Create values={boxs[3]} onClick={() => handleClick(3)} />
        <Create values={boxs[4]} onClick={() => handleClick(4)} />
        <Create values={boxs[5]} onClick={() => handleClick(5)} />
      </div>
      <div className="board-row">
        <Create values={boxs[6]} onClick={() => handleClick(6)} />
        <Create values={boxs[7]} onClick={() => handleClick(7)} />
        <Create values={boxs[8]} onClick={() => handleClick(8)} />
      </div>
    </>
  );
}

export default function Game() {
  const [history, setHistory] = useState([Array(9).fill(null)]);
  const [currentMove, setCurrentMove] = useState(0);
  const next = currentMove % 2 === 0;
  const currentSquares = history[currentMove];

  function handlePlay(nextSquares) {
    const nextHistory = [...history.slice(0, currentMove + 1), nextSquares];
    setHistory(nextHistory);
    setCurrentMove(nextHistory.length - 1);
  }

  function jumpTo(nextMove) {
    setCurrentMove(nextMove);
  }

  const moves = history.map((boxs, move) => {
    let description;
    if (move > 0) {
      description = 'Go to move #' + move;
    } else {
      description = 'Go to game start';
    }
    return (
      <li key={move}>
        <button onClick={() => jumpTo(move)}>{description}</button>
      </li>
    );
  });

  return (
    <div className="game">
      <div className="game-board">
        <Board next={next} boxs={currentSquares} play={handlePlay} />
      </div>
      <div className="game-info">
        <ol>{moves}</ol>
      </div>
    </div>
  );
}

function calculateWinner(boxs) {
  const lines = [
    [0, 1, 2],
    [3, 4, 5],
    [6, 7, 8],
    [0, 3, 6],
    [1, 4, 7],
    [2, 5, 8],
    [0, 4, 8],
    [2, 4, 6],
  ];
  for (let i = 0; i < lines.length; i++) {
    const [a, b, c] = lines[i];
    if (boxs[a] && boxs[a] === boxs[b] && boxs[a] === boxs[c]) {
      return boxs[a];
    }
  }
  return null;
}
